import styled from 'styled-components';
import Layout from '../components/Layout';
 
const Actividades = () => {
 
    return ( 
        <>
            <Layout title="La Rioja Turismo - Actividades">
                <h1> Actividades</h1>
            </Layout>
        </>
     );
}
 
export default Actividades;
